function strip_html_tags(str){if(str===null||str==="")return"";else str=str.toString();return str.replace(/<[^>]*>/g,"")}function validatePhoneData(phone,country){var v_countryPhoneLength={1:10,55:10,559:11};var v_countryCode=parseInt(String(country).replace(/(\(|\))/gim,""));var v_phoneString=String(phone);return parseInt(v_phoneString.length)>=parseInt(v_countryPhoneLength[v_countryCode])}function validateZipData(zip,country){var v_countryZipLength={1:5,55:8};var v_countryCode=parseInt(String(country).replace(/(\(|\))/gim,""));var v_zipString=String(zip);return parseInt(v_zipString.length)>=parseInt(v_countryZipLength[v_countryCode])}function pwdStrenghCheck(pwd){var v_pwdData=new RegExp(/(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9])(?=.*[!@#$%&*?]).{8,}/g);return v_pwdData.test(pwd)}function initMagnificPopup(classID){console.log("initMagnificPopup");$("."+classID).magnificPopup({type:"image",closeOnContentClick:true,mainClass:"mfp-img-mobile",image:{verticalFit:true}})}var v_setTooltip=function(){$('[data-toggle="tooltip"]').tooltip()};